from CodeTimer import Timer

class Solution:
    
    totalTimer = Timer()

    def numIslands(self, grid: list[list[str]]) -> int:

        curr_cluster = 0
        cluster_mapper = dict()
        combined_mapper = set()
        combined_clusters = set()
        output_clusters: list[set] = list()
        
        for i, row in enumerate(grid):
            for j, num in enumerate(row):
                if num == "1":
                    try:
                        top_cluster = cluster_mapper[(i-1, j)]
                    except KeyError:
                        top_cluster = -1
                    
                    try:
                        left_cluster = cluster_mapper[(i, j-1)]
                    except KeyError:
                        left_cluster = -1

                    if top_cluster >= 0 and left_cluster >= 0:
                        cluster_mapper[(i, j)] = left_cluster
                        if top_cluster != left_cluster:
                            mapping = tuple(sorted([left_cluster, top_cluster]))
                            if mapping not in combined_mapper:
                                combined_mapper.add(mapping)
                                x, y = left_cluster, top_cluster
                                x_idx, y_idx = -1, -1
                                
                                combined_clusters.add(x)
                                combined_clusters.add(y)
                                output_clusters
                    elif top_cluster >= 0:
                        cluster_mapper[(i, j)] = top_cluster
                    elif left_cluster >= 0:
                        cluster_mapper[(i, j)] = left_cluster
                    else:
                        cluster_mapper[(i, j)] = curr_cluster
                        curr_cluster += 1
        
        output_clusters: list[set] = list()
        
        
        for x, y in combined_mapper:
            
            for i, cluster in enumerate(output_clusters):
                if x in cluster:
                    x_idx = i
                if y in cluster:
                    y_idx = i
                if x_idx >= 0 and y_idx >= 0:
                    break

            if x_idx >= 0 and y_idx >= 0 and x_idx != y_idx:
                base_cluster = output_clusters.pop(max(x_idx, y_idx))
                output_clusters.append(base_cluster.union(output_clusters.pop(min(x_idx,y_idx))))
            elif x_idx >= 0:
                output_clusters[x_idx].add(y)
            elif y_idx >= 0:
                output_clusters[y_idx].add(x)
            else:
                output_clusters.append({x,y})

        return curr_cluster - len(combined_clusters) + len(output_clusters)
                    
        
